module latchdr(ENA, D, R, Q);
  input ENA, D, R;
  output Q;
  wire ENA, D, R;
  wire Q;
  wire next_state;
  reg  qi;
  assign #1 Q = qi;
  assign next_state = D;
  always 
    @(next_state or ENA or R) 
      if (!R) 
        qi <= 0;
      else begin
        if (ENA) 
          qi <= next_state;
      end
  initial 
    qi <= 1'b0;
endmodule

module fflopd(CK, D, Q);
  input CK, D;
  output Q;
  wire CK, D;
  wire Q;
  wire next_state;
  reg  qi;
  assign #1 Q = qi;
  assign next_state = D;
  always 
    @(posedge CK) 
      qi <= next_state;
  initial 
    qi <= 1'b0;
endmodule
